                    $"<h6> Le ha dado covid: {request.Covid_confirmation}</h6>" +
                    $"<h6> Justificación de solitud: {request.Justify}</h6>";
                    
                MailSender OnSend = new MailSender
                    ("wondereggi3551@gmail.com", 
                        request.Email, 
