                OnSend.SendMail();
                
                success = $"Solicitud enviada, gracias {request.Name} {request.LastName} por preferir nuestros servicios!";
                
                request = new Request();
                DropId = "0";
            }
        }
        catch (Exception)
        {
            failed = "Ha ocurrido un error con su solicitud...";
        }
    }

